import React from 'react'
import styled from 'styled-components'

function NavBarButton() {
  return (
    <NavBarButtonContainer>
      <ButtonContainer>
        <Button>Work Trip</Button>
        <Button>Price</Button>
        <Button>Work Trip</Button>
        <Button>Price</Button>
        <Button>Work Trip</Button>
        <Button>Price</Button>
      </ButtonContainer>
      <ToggleContainer>
        <div className="toggle-btn">
          <div className="inner-circle"></div>
        </div>
      </ToggleContainer>
    </NavBarButtonContainer>
  )
}

export default NavBarButton

const NavBarButtonContainer = styled.div`
display:flex;
`
const ButtonContainer = styled.div`
display:flex;
width:50%;
`
const ToggleContainer = styled.div`
display:flex;
width:50%;
align-items:center;
.toggle-btn{
  margin-left:auto;
  margin-right:50px;
  background-color:blue;
  width:60px;
  height:30px;
  border-radius:30px;
  padding:5px;
}
.inner-circle{
  width:30px;
  height:30px;
  background:#fff;
  border-radius:50%;
}
`
const Button = styled.button`
border:1px solid grey;
border-radius:5px;
background:white;
padding:0.5rem 0.8rem;
margin:10px;
cursor: pointer;
`
